class FABSUser:
    def __init__(self, username):
        self.username = username
        self.submissions = []

    def submit_fabs_data(self, data):
        self.submissions.append(data)
        logger.info(f"FABS data submitted by {self.username}")

    def view_fabs_submissions(self):
        logger.info(f"Viewing FABS submissions for {self.username}")
        return self.submissions

class BrokerUser:
