class SubmissionManager:
    def __init__(self):
        self.fabs_users = {}
        self.broker_users = {}

    def register_fabs_user(self, username):
        self.fabs_users[username] = FABSUser(username)

    def register_broker_user(self, username):
        self.broker_users[username] = BrokerUser(username)

    def get_fabs_user(self, username):
        return self.fabs_users.get(username)

    def get_broker_user(self, username):
        return self.broker_users.get(username)

class Application:
    def __init__(self):
        self.submission_manager = SubmissionManager()
        self.developer = Developer("Developer")
        self.ui_sme = UISME("UI SME")

    def run(self):
        # Register users
        self.submission_manager.register_fabs_user("FABS User")
        self.submission_manager.register_broker_user("Broker User")

        # Get users
        fabs_user = self.submission_manager.get_fabs_user("FABS User")
        broker_user = self.submission_manager.get_broker_user("Broker User")

        # Submit FABS data
        fabs_user.submit_fabs_data({"id": 1, "data": "FABS data"})

        # Submit broker data
        broker_user.submit_data({"id": 1, "data": "Broker data"})

        # View FABS submissions
        print(fabs_user.view_fabs_submissions())

        # View broker submissions
        print(broker_user.view_submissions())

        # Log message
        self.developer.log_message("Test message")

        # Update broker validation rule table
        self.developer.update_broker_validation_rule_table(["rule1", "rule2"])

        # Add GTAS window data
        self.developer.add_gtas_window_data({"id": 1, "data": "GTAS data"})

        # Manage D files generation requests
        self.developer.manage_d_files_generation_requests({"id": 1, "request": "D files request"})

        # Provide user testing results
        self.ui_sme.provide_user_testing_results({"id": 1, "results": "User testing results"})

if __name__ == "__main__":
    app = Application()
    app.run()
